import React from "react";
import EditableField from "../EditableField/EditableField";

import "./MsgTypes.css";

function MsgTypes(props) {
  let msgTypes = [
    "Screen Shot",
    "IsTyping",
    "Sending To Group",
    "Insert Image",
    "Voice Note",
    "External Chat"
  ]

  return (
    <div className="MsgTypes">
      {msgTypes.map(
        (value, index) => (
          <div className="MsgTypes-name" key={index} onClick={props.selectedMsgType ? props.selectedMsgType(value): {}}>
            {value}
          </div>
        )
      )}
    </div>
  );
}

export default MsgTypes;
